/*Table structure for table `ct_bookings` */

DROP TABLE IF EXISTS `ct_bookings`;

CREATE TABLE `ct_bookings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) NOT NULL,
  `client_id` bigint(20) NOT NULL,
  `order_date` date NOT NULL,
  `booking_date_time` datetime NOT NULL,
  `service_id` int(11) DEFAULT 0,
  `method_id` int(11) DEFAULT 0,
  `method_unit_id` int(11) DEFAULT 0,
  `method_unit_qty` double DEFAULT 0,
  `method_unit_qty_rate` double DEFAULT 0,
  `booking_status` enum('A','C','R','CC','CS','CO','MN','RS','CNF') NOT NULL COMMENT 'A=active, C=confirm, R=Reject, CC=Cancel by Client, CS=Cancel by service provider,CO=Completed,MN=MARK AS NOSHOW.CNF-Confirmed',
  `reject_reason` varchar(200) DEFAULT '0',
  `reminder_status` enum('0','1') NOT NULL DEFAULT '0' COMMENT '0=Email Not Sent,1=Email Sent',
  `lastmodify` datetime NOT NULL,
  `read_status` enum('R','U') NOT NULL DEFAULT 'U',
  `staff_ids` varchar(160) DEFAULT NULL,
  `gc_event_id` varchar(255) DEFAULT NULL,
  `gc_staff_event_id` varchar(255) DEFAULT NULL,
  `payment_intent_id` varchar(255) DEFAULT NULL,
  `payment_status` tinyint(4) DEFAULT 0,
  `payment_capture_status` text DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

